import React from 'react';
import NavItems from './NavItems';
import About from './About';
import Services from './Services';
import Contact from './Contact';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
 


// const counter = 8; this is just like a variable that doesnt change

//this below is our component that returns JSX to index.html 
function Nav(){

    return(
        <Router>
            <div className="container navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
                <a class="navbar-brand" href="#">Start Bootstrap</a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>
                <Switch>
                    <NavItems/>
                    <Route path='/' exact/>
                    <Route path='/about' exact component={About} />
                    <Route path='/services' exact component={About} />
                    <Route path='/contactus' exact component={About} />
                </Switch>
   
            </div>
        </Router>

    );
}


export default Nav;
